INSERT INTO edunet_course VALUES(10,'Cervantes Don Quixote','SPAN 300','The course facilitates a close reading of Don Quixote in the artistic and historical context of renaissance and baroque Spain. Students are also expected to read four of Cervantes Exemplary Stories, Cervantes Don Quixote: A Casebook, and J.H. Elliotts Imperial Spain. Cervantes work will be discussed in relation to paintings by Velzquez. The question of why Don Quixote is read today will be addressed throughout the course. Students are expected to know the book, the background readings and the materials covered in the lectures and class discussions.','cervantes-don-quixote','Fall 2009','https://oyc.yale.edu/spanish-and-portuguese/span-300','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2009.');
INSERT INTO edunet_course VALUES(15,'Freshman Organic Chemistry I','CHEM 125a','This is the first semester in a two-semester introductory course focused on current theories of structure and mechanism in organic chemistry, their historical development, and their basis in experimental observation. The course is open to freshmen with excellent preparation in chemistry and physics, and it aims to develop both taste for original science and intellectual skills necessary for creative research.','freshman-organic-chemistry-i','Fall 2008','https://oyc.yale.edu/chemistry/chem-125a','This Yale College course, taught on campus three times per week for 50 minutes, was recorded for Open Yale Courses in Fall 2008.');
INSERT INTO edunet_course VALUES(16,'Freshman Organic Chemistry II','CHEM 125b','This is a continuation of Freshman Organic Chemistry I (CHEM 125a), the introductory course on current theories of structure and mechanism in organic chemistry for students with excellent preparation in chemistry and physics. This semester treats simple and complex reaction mechanisms, spectroscopy, organic synthesis, and some molecules of nature.','freshman-organic-chemistry-ii','Spring 2011','https://oyc.yale.edu/chemistry/chem-125b','This Yale College course, taught on campus three times per week for 50 minutes, was recorded for Open Yale Courses in Spring 2011.');
INSERT INTO edunet_course VALUES(17,'Introduction to Ancient Greek History','CLCV 205','This is an introductory course in Greek history tracing the development of Greek civilization as manifested in political, intellectual, and creative achievements from the Bronze Age to the end of the classical period. Students read original sources in translation as well as the works of modern scholars.','introduction-ancient-greek-history','Fall 2007','https://oyc.yale.edu/classics/clcv-205','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2007.');
INSERT INTO edunet_course VALUES(18,'Principles of Evolution, Ecology and Behavior','EEB 122','This course presents the principles of evolution, ecology, and behavior for students beginning their study of biology and of the environment. It discusses major ideas and results in a manner accessible to all Yale College undergraduates. Recent advances have energized these fields with results that have implications well beyond their boundaries: ideas, mechanisms, and processes that should form part of the toolkit of all biologists and educated citizens.','principles-evolution-ecology-and-behavior','Spring 2009','https://oyc.yale.edu/ecology-and-evolutionary-biology/eeb-122','This Yale College course, taught on campus three times per week for 50 minutes, was recorded for Open Yale Courses in Spring 2009.');
INSERT INTO edunet_course VALUES(19,'Financial Markets (2008)','ECON 252','Financial institutions are a pillar of civilized society, supporting people in their productive ventures and managing the economic risks they take on. The workings of these institutions are important to comprehend if we are to predict their actions today and their evolution in the coming information age. The course strives to offer understanding of the theory of finance and its relation to the history, strengths and imperfections of such institutions as banking, insurance, securities, futures, and other derivatives markets, and the future of these institutions over the next century.','financial-markets-2008','Spring 2008','https://oyc.yale.edu/economics/econ-252-08','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Spring 2008.');
INSERT INTO edunet_course VALUES(20,'Financial Markets (2011)','ECON 252','An overview of the ideas, methods, and institutions that permit human society to manage risks and foster enterprise. Description of practices today and analysis of prospects for the future. Introduction to risk management and behavioral finance principles to understand the functioning of securities, insurance, and banking industries.','financial-markets-2011','Spring 2011','https://oyc.yale.edu/economics/econ-252','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Spring 2011.');
INSERT INTO edunet_course VALUES(21,'Financial Theory','ECON 251','This course attempts to explain the role and the importance of the financial system in the global economy. Rather than separating off the financial world from the rest of the economy, financial equilibrium is studied as an extension of economic equilibrium. The course also gives a picture of the kind of thinking and analysis done by hedge funds.','financial-theory','Fall 2009','https://oyc.yale.edu/economics/econ-251','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2009.');
INSERT INTO edunet_course VALUES(22,'Game Theory','ECON 159','This course is an introduction to game theory and strategic thinking. Ideas such as dominance, backward induction, Nash equilibrium, evolutionary stability, commitment, credibility, asymmetric information, adverse selection, and signaling are discussed and applied to games played in class and to examples drawn from economics, politics, the movies, and elsewhere.','game-theory','Fall 2007','https://oyc.yale.edu/economics/econ-159','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2007.');
INSERT INTO edunet_course VALUES(23,'Introduction to Theory of Literature','ENGL 300','This is a survey of the main trends in twentieth-century literary theory. Lectures will provide background for the readings and explicate them where appropriate, while attempting to develop a coherent overall context that incorporates philosophical and social perspectives on the recurrent questions: what is literature, how is it produced, how can it be understood, and what is its purpose?','introduction-theory-literature','Spring 2009','https://oyc.yale.edu/english/engl-300','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring, 2009. The Open Yale Courses Series. For more information about Professor Frys book Theory of Literature, http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300180831.');
INSERT INTO edunet_course VALUES(24,'Milton','ENGL 220','This class is a study of Miltons poetry, with attention paid to his literary sources, his contemporaries, his controversial prose, and his decisive influence on the course of English poetry. Throughout the course, Professor Rogers explores the advantages and limitations of a diverse range of interpretive techniques and theoretical concerns in Milton scholarship and criticism. Lectures include close readings of lyric and epic poetry, prose, and letters; biographical inquiries; examinations of historical and political contexts; and engagement with critical debates.','milton','Fall 2007','https://oyc.yale.edu/english/engl-220','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2007.Take this course for Yale College credit. John Rogers is teaching his course through the Yale Summer Online. This course runs from June 3 - July 5 and features extensive interaction with faculty and fellow students.http://summer.yale.edu/find-your-program/online-courses Click here to learn more and apply to this course.');
INSERT INTO edunet_course VALUES(25,'Modern Poetry','ENGL 310','This course covers the body of modern poetry, its characteristic techniques, concerns, and major practitioners. The authors discussed range from Yeats, Eliot, and Pound, to Stevens, Moore, Bishop, and Frost with additional lectures on the poetry of World War One, Imagism, and the Harlem Renaissance. Diverse methods of literary criticism are employed, such as historical, biographical, and gender criticism.','modern-poetry','Spring 2007','https://oyc.yale.edu/english/engl-310','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2007.');
INSERT INTO edunet_course VALUES(26,'American Novel Since 1945','ENGL 291','In The American Novel Since 1945 students will study a wide range of works from 1945 to the present. The course traces the formal and thematic developments of the novel in this period, focusing on the relationship between writers and readers, the conditions of publishing, innovations in the novels form, fictions engagement with history, and the changing place of literature in American culture. The reading list includes works by Richard Wright, Flannery OConnor, Vladimir Nabokov, Jack Kerouac, J. D. Salinger, Thomas Pynchon, John Barth, Maxine Hong Kingston, Toni Morrison, Marilynne Robinson, Cormac McCarthy, Philip Roth and Edward P. Jones. The course concludes with a contemporary novel chosen by the students in the class.','american-novel-1945','Spring 2008','https://oyc.yale.edu/english/engl-291','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2008.');
INSERT INTO edunet_course VALUES(27,'Environmental Politics and Law','EVST 255','Can law change human behavior to be less environmentally damaging? Law will be examined through case histories including: environmental effects of national security, pesticides, air pollution, consumer products, plastics, parks and protected area management, land use, urban growth and sprawl, public/private transit, drinking water standards, food safety, and hazardous site restoration. In each case we will review the structure of law and evaluate its strengths and weaknesses.','environmental-politics-and-law','Spring 2010','https://oyc.yale.edu/environmental-studies/evst-255','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2010.');
INSERT INTO edunet_course VALUES(28,'Atmosphere, the Ocean, and Environmental Change','GG 140','This course explores the physical processes that control Earths atmosphere, ocean, and climate. Quantitative methods for constructing mass and energy budgets. Topics include clouds, rain, severe storms, regional climate, the ozone layer, air pollution, ocean currents and productivity, the seasons, El Nio, the history of Earths climate, global warming, energy, and water resources.','geology-and-geophysics','Fall 2011','https://oyc.yale.edu/geology-and-geophysics/gg-140','This Yale College course, taught on campus three times per week for 50 minutes, was recorded for Open Yale Courses in Fall 2011.');
INSERT INTO edunet_course VALUES(29,'American Revolution','HIST 116','The American Revolution entailed some remarkable transformationsconverting British colonists into American revolutionaries, and a cluster of colonies into a confederation of states with a common causebut it was far more complex and enduring than the fighting of a war. As John Adams put it, The Revolution was in the Minds of the people before a drop of blood was drawn at Lexingtonand it continued long past Americas victory at Yorktown. This course will examine the Revolution from this broad perspective, tracing the participants shifting sense of themselves as British subjects, colonial settlers, revolutionaries, and Americans.','american-revolution','Spring 2010','https://oyc.yale.edu/history/hist-116','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2010.');
INSERT INTO edunet_course VALUES(30,'Civil War and Reconstruction Era, 1845-1877','HIST 119','This course explores the causes, course, and consequences of the American Civil War, from the 1840s to 1877. The primary goal of the course is to understand the multiple meanings of a transforming event in American history. Those meanings may be defined in many ways: national, sectional, racial, constitutional, individual, social, intellectual, or moral. Four broad themes are closely examined: the crisis of union and disunion in an expanding republic; slavery, race, and emancipation as national problem, personal experience, and social process; the experience of modern, total war for individuals and society; and the political and social challenges of Reconstruction.','civil-war-and-reconstruction-era-1845-1877','Spring 2008','https://oyc.yale.edu/history/hist-119','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2008.');
INSERT INTO edunet_course VALUES(31,'Early Middle Ages, 284-1000','HIST 210','Major developments in the political, social, and religious history of Western Europe from the accession of Diocletian to the feudal transformation. Topics include the conversion of Europe to Christianity, the fall of the Roman Empire, the rise of Islam and the Arabs, the Dark Ages, Charlemagne and the Carolingian renaissance, and the Viking and Hungarian invasions.','early-middle-ages-284-1000','Fall 2011','https://oyc.yale.edu/history/hist-210','This Yale College course, taught on campus two times per week for 50 minutes, was recorded for Open Yale Courses in Fall 2011.');
INSERT INTO edunet_course VALUES(32,'European Civilization, 1648-1945','HIST 202','This course offers a broad survey of modern European history, from the end of the Thirty Years War to the aftermath of World War II. Along with the consideration of major events and figures such as the French Revolution and Napoleon, attention will be paid to the experience of ordinary people in times of upheaval and transition. The period will thus be viewed neither in terms of historical inevitability nor as a procession of great men, but rather through the lens of the complex interrelations between demographic change, political revolution, and cultural development. Textbook accounts will be accompanied by the study of exemplary works of art, literature, and cinema.','european-civilization-1648-1945','Fall 2008','https://oyc.yale.edu/history/hist-202','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2008.');
INSERT INTO edunet_course VALUES(33,'Epidemics in Western Society Since 1600','HIST 234','This course consists of an international analysis of the impact of epidemic diseases on western society and culture from the bubonic plague to HIV/AIDS and the recent experience of SARS and swine flu. Leading themes include: infectious disease and its impact on society; the development of public health measures; the role of medical ethics; the genre of plague literature; the social reactions of mass hysteria and violence; the rise of the germ theory of disease; the development of tropical medicine; a comparison of the social, cultural, and historical impact of major infectious diseases; and the issue of emerging and re-emerging diseases.','epidemics-western-society-1600','Spring 2010','https://oyc.yale.edu/history/hist-234','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2010.');
INSERT INTO edunet_course VALUES(34,'Early Modern England: Politics, Religion, and Society under the Tudors and Stuarts','HIST 251','This course is intended to provide an up-to-date introduction to the development of English society between the late fifteenth and the early eighteenth centuries. Particular issues addressed in the lectures will include: the changing social structure; households; local communities; gender roles; economic development; urbanization; religious change from the Reformation to the Act of Toleration; the Tudor and Stuart monarchies; rebellion, popular protest and civil war; witchcraft; education, literacy and print culture; crime and the law; poverty and social welfare; the changing structures and dynamics of political participation and the emergence of parliamentary government.','early-modern-england-politics-religion-and-society-under-tudors-and-stuarts','Fall 2009','https://oyc.yale.edu/history/hist-251','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2009.');
INSERT INTO edunet_course VALUES(35,'France Since 1871','HIST 276','This course covers the emergence of modern France. Topics include the social, economic, and political transformation of France; the impact of Frances revolutionary heritage, of industrialization, and of the dislocation wrought by two world wars; and the political response of the Left and the Right to changing French society.','france-1871','Fall 2007','https://oyc.yale.edu/history/hist-276','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2007.');
INSERT INTO edunet_course VALUES(36,'Roman Architecture','HSAR 252','This course is an introduction to the great buildings and engineering marvels of Rome and its empire, with an emphasis on urban planning and individual monuments and their decoration, including mural painting. While architectural developments in Rome, Pompeii, and Central Italy are highlighted, the course also provides a survey of sites and structures in what are now North Italy, Sicily, France, Spain, Germany, Greece, Turkey, Croatia, Jordan, Lebanon, Libya, and North Africa. The lectures are illustrated with over 1,500 images, many from Professor Kleiners personal collection.','roman-architecture','Spring 2009','https://oyc.yale.edu/history-of-art/hsar-252','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Spring 2009.');
INSERT INTO edunet_course VALUES(37,'Dante in Translation','ITAL 310','The course is an introduction to Dante and his cultural milieu through a critical reading of the Divine Comedy and selected minor works (Vita nuova, Convivio, De vulgari eloquentia, Epistle to Cangrande). An analysis of Dantes autobiography, the Vita nuova, establishes the poetic and political circumstances of the Comedys composition. Readings of Inferno, Purgatory and Paradise seek to situate Dantes work within the intellectual and social context of the late Middle Ages, with special attention paid to political, philosophical and theological concerns. Topics in the Divine Comedy explored over the course of the semester include the relationship between ethics and aesthetics; love and knowledge; and exile and history.','dante-translation','Fall 2008','https://oyc.yale.edu/italian-language-and-literature/ital-310','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2008. The Open Yale Courses Series. For more information about Professor Mazzottas book Reading Dante, http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300191356 click here.');
INSERT INTO edunet_course VALUES(38,'Global Problems of Population Growth','MCDB 150','This survey course introduces students to the important and basic material on human fertility, population growth, the demographic transition and population policy. Topics include: the human and environmental dimensions of population pressure, demographic history, economic and cultural causes of demographic change, environmental carrying capacity and sustainability. Political, religious and ethical issues surrounding fertility are also addressed. The lectures and readings attempt to balance theoretical and demographic scale analyzes with studies of individual humans and communities. The perspective is global with both developed and developing countries included.','global-problems-population-growth','Spring 2009','https://oyc.yale.edu/molecular-cellular-and-developmental-biology/mcdb-150','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Spring 2009.');
INSERT INTO edunet_course VALUES(39,'Philosophy and the Science of Human Nature','PHIL 181','Philosophy and the Science of Human Nature pairs central texts from Western philosophical tradition (including works by Plato, Aristotle, Epictetus, Hobbes, Kant, Mill, Rawls, and Nozick) with recent findings in cognitive science and related fields. The course is structured around three intertwined sets of topics: Happiness and Flourishing; Morality and Justice; and Political Legitimacy and Social Structures.','philosophy-and-science-human-nature','Spring 2011','https://oyc.yale.edu/philosophy/phil-181','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2011.');
INSERT INTO edunet_course VALUES(40,'Death','PHIL 176','There is one thing I can be sure of: I am going to die. But what am I to make of that fact? This course will examine a number of issues that arise once we begin to reflect on our mortality. The possibility that death may not actually be the end is considered. Are we, in some sense, immortal? Would immortality be desirable? Also a clearer notion of what it is to die is examined. What does it mean to say that a person has died? What kind of fact is that? And, finally, different attitudes to death are evaluated. Is death an evil? How? Why? Is suicide morally permissible? Is it rational? How should the knowledge that I am going to die affect the way I live my life?','death','Spring 2007','https://oyc.yale.edu/death/phil-176','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2007.');
INSERT INTO edunet_course VALUES(41,'Fundamentals of Physics I','PHYS 200','This course provides a thorough introduction to the principles and methods of physics for students who have good preparation in physics and mathematics. Emphasis is placed on problem solving and quantitative reasoning. This course covers Newtonian mechanics, special relativity, gravitation, thermodynamics, and waves.','fundamentals-physics-i','Fall 2006','https://oyc.yale.edu/physics/phys-200','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2006. The Open Yale Courses Book Series. For more information about Professor Shankar''s book based on the lectures from this course, Fundamentals of Physics: Mechanics, Relativity, and Thermodynamics http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300192209 click here.');
INSERT INTO edunet_course VALUES(42,'Fundamentals of Physics II','PHYS 201','This is a continuation of Fundamentals of Physics, I (PHYS 200), the introductory course on the principles and methods of physics for students who have good preparation in physics and mathematics. This course covers electricity, magnetism, optics and quantum mechanics.','fundamentals-physics-ii','Spring 2010','https://oyc.yale.edu/physics/phys-201','75 minute lectures, twice per week The Open Yale Courses Book Series. For more information about Professor Shankar''s book based on PHYS 200, Fundamentals of Physics: Mechanics, Relativity, and Thermodynamics http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300192209 click here');
INSERT INTO edunet_course VALUES(43,'Capitalism: Success, Crisis, and Reform','PLSC 270','In this course, we will seek to interpret capitalism using ideas from biological evolution: firms pursuing varied strategies and facing extinction when those strategies fail are analogous to organisms struggling for survival in nature. For this reason, it is less concerned with ultimate judgment of capitalism than with the ways it can be shaped to fit our more specific objectivesfor the natural environment, public health, alleviation of poverty, and development of human potential in every child. Each book we read will be explicitly or implicitly an argument about good and bad consequences of capitalism.','capitalism-success-crisis-and-reform','Fall 2009','https://oyc.yale.edu/political-science/plsc-270','This Yale College course, taught on campus twice per week for 50 minutes, was videotaped for Open Yale Courses in Fall 2009.');
INSERT INTO edunet_course VALUES(44,'Introduction to Political Philosophy','PLSC 114','This course is intended as an introduction to political philosophy as seen through an examination of some of the major texts and thinkers of the Western political tradition. Three broad themes that are central to understanding political life are focused upon: the polis experience (Plato, Aristotle), the sovereign state (Machiavelli, Hobbes), constitutional government (Locke), and democracy (Rousseau, Tocqueville). The way in which different political philosophies have given expression to various forms of political institutions and our ways of life are examined throughout the course.','introduction-political-philosophy','Fall 2006','https://oyc.yale.edu/political-science/plsc-114','This Yale College course, taught on campus twice per week for 50 minutes, was videotaped for Open Yale Courses in Fall 2006. The Open Yale Courses Series. For more information about Professor Smiths book Political Philosophy, http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300181807 click here.');
INSERT INTO edunet_course VALUES(45,'Introduction to Psychology','PSYC 110','What do your dreams mean? Do men and women differ in the nature and intensity of their sexual desires? Can apes learn sign language? Why cant we tickle ourselves? This course tries to answer these questions and many others, providing a comprehensive overview of the scientific study of thought and behavior. It explores topics such as perception, communication, learning, memory, decision-making, religion, persuasion, love, lust, hunger, art, fiction, and dreams. We will look at how these aspects of the mind develop in children, how they differ across people, how they are wired-up in the brain, and how they break down due to illness and injury.','introduction-psychology','Spring 2007','https://oyc.yale.edu/introduction-psychology/psyc-110','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Spring 2007.');
INSERT INTO edunet_course VALUES(46,'Psychology, Biology and Politics of Food','PSYC 123','This course encompasses the study of eating as it affects the health and well-being of every human. Topics include taste preferences, food aversions, the regulation of hunger and satiety, food as comfort and friendship, eating as social ritual, and social norms of blame for food problems. The politics of food discusses issues such as sustainable agriculture, organic farming, genetically modified foods, nutrition policy, and the influence of food and agriculture industries. Also examined are problems such as malnutrition, eating disorders, and the global obesity epidemic; the impact of food advertising aimed at children; poverty and food; and how each individuals eating is affected by the modern environment.','psychology-biology-and-politics-food','Spring 2008','https://oyc.yale.edu/psychology/psyc-123','This Yale College course, taught on campus twice per week for 75 minutes, was recorded for Open Yale Courses in Fall 2008.');
INSERT INTO edunet_course VALUES(47,'Introduction to the New Testament History and Literature','RLST 152','This course provides a historical study of the origins of Christianity by analyzing the literature of the earliest Christian movements in historical context, concentrating on the New Testament. Although theological themes will occupy much of our attention, the course does not attempt a theological appropriation of the New Testament as scripture. Rather, the importance of the New Testament and other early Christian documents as ancient literature and as sources for historical study will be emphasized. A central organizing theme of the course will focus on the differences within early Christianity (-ies).','introduction-new-testament-history-and-literature','Spring 2009','https://oyc.yale.edu/religious-studies/rlst-152','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2009. The Open Yale Courses Series. For more information about Professor Martins book New Testament History and Literature, http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300180855 click here.');
INSERT INTO edunet_course VALUES(48,'Introduction to the Old Testament (Hebrew Bible)','RLST 145','This course examines the Old Testament (Hebrew Bible) as an expression of the religious life and thought of ancient Israel, and a foundational document of Western civilization. A wide range of methodologies, including source criticism and the historical-critical school, tradition criticism, redaction criticism, and literary and canonical approaches are applied to the study and interpretation of the Bible. Special emphasis is placed on the Bible against the backdrop of its historical and cultural setting in the Ancient Near East.','introduction-old-testament-hebrew-bible','Fall 2006','https://oyc.yale.edu/religious-studies/rlst-145','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2006. The Open Yale Courses Series. For more information about Professor Hayes book, Introduction to the Bible, http://yalepress.yale.edu/yupbooks/book.asp?isbn=9780300181791 click here.');
INSERT INTO edunet_course VALUES(49,'Foundations of Modern Social Theory','SOCY 151','This course provides an overview of major works of social thought from the beginning of the modern era through the 1920s. Attention is paid to social and intellectual contexts, conceptual frameworks and methods, and contributions to contemporary social analysis. Writers include Hobbes, Locke, Rousseau, Montesquieu, Adam Smith, Marx, Weber, and Durkheim.','foundations-modern-social-theory','Fall 2009','https://oyc.yale.edu/sociology/socy-151','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Fall 2009.');
INSERT INTO edunet_course VALUES(51,'Frontiers and Controversies in Astrophysics','ASTR 160','This course focuses on three particularly interesting areas of astronomy that are advancing very rapidly: Extra-Solar Planets, Black Holes, and Dark Energy. Particular attention is paid to current projects that promise to improve our understanding significantly over the next few years. The course explores not just what is known, but what is currently not known, and how astronomers are going about trying to find out.','frontiers-and-controversies-astrophysics','Spring 2007','https://oyc.yale.edu/astronomy/astr-160','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2007.');
INSERT INTO edunet_course VALUES(52,'Hemingway, Fitzgerald, Faulkner','AMST 246',replace(replace('This course examines major works by Hemingway, Fitzgerald, and Faulkner, exploring their interconnections on three analytic scales: the macro history of the United States and the world; the formal and stylistic innovations of modernism; and the small details of sensory input and psychic life.\r\n\r\nWarning: Some of the lectures in this course contain graphic content and/or adult language that some users may find disturbing.','\r',char(13)),'\n',char(10)),'hemingway-fitzgerald-faulkner','Fall 2011','https://oyc.yale.edu/american-studies/amst-246','This Yale College course, taught on campus two times per week for 50 minutes, was recorded for Open Yale Courses in Fall 2011.');
INSERT INTO edunet_course VALUES(53,'Frontiers of Biomedical Engineering','BENG 100','The course covers basic concepts of biomedical engineering and their connection with the spectrum of human activity. It serves as an introduction to the fundamental science and engineering on which biomedical engineering is based. Case studies of drugs and medical products illustrate the product development-product testing cycle, patent protection, and FDA approval. It is designed for science and non-science majors.','frontiers-biomedical-engineering','Spring 2008','https://oyc.yale.edu/biomedical-engineering/beng-100','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2008.');
INSERT INTO edunet_course VALUES(59,'African American History: From Emancipation to the Present','AFAM 162',replace(replace('The purpose of this course is to examine the African American experience in the United States from 1863 to the present. Prominent themes include the end of the Civil War and the beginning of Reconstruction; African Americans urbanization experiences; the development of the modern civil rights movement and its aftermath; and the thought and leadership of Booker T. Washington, Ida B. Wells-Barnett, W.E.B. Du Bois, Marcus Garvey, Martin Luther King Jr., and Malcolm X.\r\n\r\nWarning: Some of the lectures in this course contain graphic content and/or adult language that some users may find disturbing.','\r',char(13)),'\n',char(10)),'african-american-history-emancipation-present','Spring 2010','https://oyc.yale.edu/african-american-studies/afam-162','This Yale College course, taught on campus twice per week for 50 minutes, was recorded for Open Yale Courses in Spring 2010.');
